        <h2 style="margin-bottom: 20px;">Notable Positions (Top 50 by Notional Value - Last Hour, Unique Addresses)</h2>

    <!-- DataTables initialization script -->
    <script>
        $(document).ready(function() {
            // Add a custom filter container above the table
            $('<div id="custom-filters" style="margin-bottom: 20px; padding: 15px; background-color: #000000; border-radius: 5px; display: flex; align-items: center;"></div>')
                .insertBefore('#positions-table');
            
            // Add liquidation price range filter
            var priceFilterHtml = `
                <div style="margin-right: 20px;">
                    <label style="font-weight: bold; margin-right: 10px; color: #e0e0e0;">Liquidation Price Range:</label>
                    <input id="min-price" type="number" placeholder="Min $" style="width: 120px; margin-right: 10px; background: #111; color: white; border: 1px solid #333; padding: 8px; border-radius: 4px;">
                    <span style="margin-right: 10px;">to</span>
                    <input id="max-price" type="number" placeholder="Max $" style="width: 120px; background: #111; color: white; border: 1px solid #333; padding: 8px; border-radius: 4px;">
                    <button id="apply-price-filter" style="margin-left: 10px; background: #0066cc; color: white; border: none; padding: 8px 15px; border-radius: 4px; cursor: pointer;">Apply</button>
                    <button id="reset-price-filter" style="margin-left: 10px; background: #333; color: white; border: none; padding: 8px 15px; border-radius: 4px; cursor: pointer;">Reset</button>
                </div>
            `;
            
            $('#custom-filters').append(priceFilterHtml);
            
            // Initialize DataTables
            var table = $('#positions-table').DataTable({
                "paging": true,
                "ordering": true,
                "info": true,
                "searching": true,
                "order": [[2, "desc"]], // Default sort by notional value
                "pageLength": 25,
                "lengthMenu": [10, 25, 50, 100],
                "dom": '<"top"lf>rt<"bottom"ip>',
                "language": {
                    "search": "Filter: "
                },
                "columnDefs": [
                    { "type": "num", "targets": [1, 2, 3] }
                ],
                // Custom styling for DataTables elements
                "initComplete": function() {
                    $('.dataTables_wrapper .dataTables_filter input').css({
                        'background': '#111',
                        'color': 'white',
                        'border': '1px solid #333',
                        'padding': '5px',
                        'border-radius': '4px'
                    });
                    $('.dataTables_wrapper .dataTables_length select').css({
                        'background': '#111',
                        'color': 'white',
                        'border': '1px solid #333',
                        'padding': '5px',
                        'border-radius': '4px'
                    });
                    $('.dataTables_wrapper').css({
                        'color': 'white'
                    });
                    $('.dataTables_wrapper .dataTables_info').css({
                        'color': '#aaa'
                    });
                    $('.dataTables_wrapper .dataTables_paginate .paginate_button').css({
                        'background': '#111',
                        'color': 'white !important',
                        'border': '1px solid #333'
                    });
                    $('.dataTables_wrapper .dataTables_paginate .paginate_button.current').css({
                        'background': '#333',
                        'color': 'white !important'
                    });
                }
            });
            
            // Custom liquidation price range filter
            $.fn.dataTable.ext.search.push(function(settings, data, dataIndex) {
                var min = parseFloat($('#min-price').val()) || 0;
                var max = parseFloat($('#max-price').val()) || Infinity;
                
                // Extract the price from the data (remove $ and commas)
                var price = parseFloat(data[3].replace(/[$,]/g, '')) || 0;
                
                return (price >= min && price <= max);
            });
            
            // Event listeners for the filter buttons
            $('#apply-price-filter').on('click', function() {
                table.draw();
            });
            
            $('#reset-price-filter').on('click', function() {
                $('#min-price').val('');
                $('#max-price').val('');
                table.draw();
            });
            
            // Also filter on Enter key press
            $('#min-price, #max-price').keypress(function(e) {
                if(e.which == 13) { // Enter key
                    table.draw();
                }
            });
            
            // Add position type filter (short/long)
            var typeFilterHtml = `
                <div>
                    <label style="font-weight: bold; margin-right: 10px; color: #e0e0e0;">Position Type:</label>
                    <select id="type-filter" style="background: #111; color: white; border: 1px solid #333; padding: 8px; border-radius: 4px;">
                        <option value="">All</option>
                        <option value="LONG">Long</option>
                        <option value="SHORT">Short</option>
                    </select>
                </div>
            `;
            
            $('#custom-filters').append(typeFilterHtml);
            
            // Position type filter
            $('#type-filter').on('change', function() {
                var selectedType = $(this).val();
                table.column(0).search(selectedType).draw();
            });
            
            // Add tooltips to explain the filters
            $('<div style="margin-top: 10px; font-size: 12px; color: #aaa;">Tip: Use the filters above to narrow down positions by liquidation price range or position type. Click column headers to sort.</div>')
                .insertAfter('#custom-filters');
            
            // Override DataTables styling for black theme
            $('head').append(`
                <style>
                    .dataTables_wrapper .dataTables_paginate .paginate_button.current, 
                    .dataTables_wrapper .dataTables_paginate .paginate_button.current:hover {
                        background: #333 !important;
                        color: white !important;
                        border: 1px solid #444 !important;
                    }
                    .dataTables_wrapper .dataTables_paginate .paginate_button:hover {
                        background: #222 !important;
                        color: white !important;
                        border: 1px solid #444 !important;
                    }
                    .dataTables_wrapper .dataTables_paginate .paginate_button {
                        background: #111 !important;
                        color: #ddd !important;
                    }
                    .dataTables_wrapper .dataTables_length, 
                    .dataTables_wrapper .dataTables_filter, 
                    .dataTables_wrapper .dataTables_info, 
                    .dataTables_wrapper .dataTables_processing, 
                    .dataTables_wrapper .dataTables_paginate {
                        color: #ddd !important;
                    }
                    table.dataTable tbody tr {
                        background-color: #000000 !important;
                    }
                    table.dataTable.stripe tbody tr.odd, 
                    table.dataTable.display tbody tr.odd {
                        background-color: #0a0a0a !important;
                    }
                    table.dataTable.hover tbody tr:hover, 
                    table.dataTable.display tbody tr:hover {
                        background-color: #111 !important;
                    }
                    table.dataTable thead th {
                        border-bottom: 1px solid #333 !important;
                    }
                    table.dataTable tfoot th {
                        border-top: 1px solid #333 !important;
                    }
                </style>
            `);
        });
    </script>
